}

#editor {
    background-color: white;
}



.tags {
    padding: 0;
}
.tags li {
    float: left; 
}

.tag {
    font-size: 13px;
    background: #eee;
    border-radius: 3px 0 0 3px;
    color: #999;
    display: inline-block;
    height: 26px;
    line-height: 26px;
    padding: 0 25px;
    padding-left: 25px !important;
    padding-right: 25px !important;
    position: relative;
    margin: 0 20px 20px 0;
    text-decoration: none;
    /* -webkit-transition: color 0.2s; */
}

.tag::before {
    background: #fff;
    border-radius: 10px;
    box-shadow: inset 0 1px rgba(0, 0, 0, 0.25);
    content: '';
    height: 6px;
    left: 10px;
    position: absolute;
    width: 6px;
    top: 10px;

}

.tag::after {
    background: #fff;
    border-bottom: 13px solid transparent;
    border-left: 10px solid #eee;
    border-top: 13px solid transparent;
    content: '';
    position: absolute;
    right: 0;
    top: 0;
}

.viewMore-btn {
    border: none;
    color: blue;
    padding: 15px 32px;
    text-align: center;
    text-decoration: none;
    display: inline-block;
    font-size: 16px;
}
.viewMore-btn:hover {
    border: none;
    color: black;
}
